import car from "../image/car.png";
import logo from "../image/logo.png";

export default function Login() {
    return (
        <div className="bg-[#895BB3] w-screen h-screen p-40">
            <div className="w-100 h-auto 0 bg-white mx-auto flex flex-row">
                <div className="bg-white w-full">
                    <img className="w-1/4" src={logo} alt="" />
                    <h1 className="font-black text-2xl">Login</h1>
                </div>
                <div className="bg-[#F4F6F5] w-full">
                    <img className="mx-auto" src={car} alt="" />
                </div>
            </div>
        </div>
    );
}
